import axios from 'axios';

export async function fetchGif(
  searchTerm: string,
  setError: (error: string) => void,
) {
  const API_KEY = 'RCt0VI3GhECXKohyi8zPeUptxfVJcWGr';

  try {
    if (!searchTerm || searchTerm.trim() == "") {
      throw new Error('Nothing has been searched');
    }
    const response = await axios.get(`https://api.giphy.com/v1/gifs/search?api_key=${API_KEY}&q=${searchTerm}&limit=5`, {
      params: {
        apiKey: API_KEY,
        q: searchTerm,
        limit: 5,
      },
    });
    console.log('Returned', response.data);
    return response.data.data;
  } catch (error) {
    console.log('Error', error.response);
    return null;
  }
}
